#include "stdafx.h" 

class Solution410 {
public:
	//binary search
	int splitArray(vector<int>& nums, int m) {
		unordered_map<int,unordered_map<int,int>> cache;
		//将从0到i的和保存在sums里
		vector<int> sums;
		for(int i=0;i<nums.size();i++){
			if(i==0){
				sums.push_back(nums[i]);
			}else{
				if( sums[sums.size()-1] + nums[i] < nums[i]){
					//溢出
					sums.push_back(INT_MAX);
				}else
					sums.push_back(sums[sums.size()-1]+nums[i]);
			}
		}
		return splitArray(nums, 0, m, cache, sums);
	}

	//cache 保存切i刀，从start开始到数组结束的最优解
	int splitArray(vector<int>& nums, int start, int m, unordered_map<int,unordered_map<int,int>>& cache, vector<int>& sumsAll) {
		if( nums.size()-start==m){
			//如果 刀数=元素数，则最佳切法只能是每个元素为一块
			int mx = nums[start];
			if(m>1)
			{
				int right;
				unordered_map<int,unordered_map<int,int>>::iterator it = cache.find(m-1);
				if( it != cache.end()){
					unordered_map<int,int>::iterator it2 = it->second.find(start+1);
					if(it2!=it->second.end()){
						right = it2->second;
					}else{
						right = splitArray(nums, start+1, m-1, cache, sumsAll);
					}
				}else{
					right = splitArray(nums, start+1, m-1, cache, sumsAll);
				}
				mx = max(mx, right);
			}
			return mx;
		}

		else if( m>1){
			//首先找到接近于小于等于average的最大数，然后从这个数开始往后分块
			int sum = sumsAll[sumsAll.size()-1];
			if(start>0) sum-=sumsAll[start-1];
			int average = sum/m;
			int low = start;
			int high = nums.size()-1;
			while(low<=high){
				int mid = (low+high)/2;
				if(mid+m>nums.size()) {
					high = mid-1;
					continue;
				}
				int sum1 = sumsAll[mid];
				if(start>0) sum1-=sumsAll[start-1];
				if( sum1 == average) break;
				else if( sum1 < average){
					low = mid+1;
				}else{
					high = mid-1;
				}
			}
			if( low>high && low>0) low--;
			int gMin = -1;
			for(int i=low;i<nums.size()-m+1;i++){
				int s = sumsAll[i];
				if(start>0) s-=sumsAll[start-1];

				int right;
				unordered_map<int,unordered_map<int,int>>::iterator it = cache.find(m-1);
				if( it != cache.end()){
					unordered_map<int,int>::iterator it2 = it->second.find(i+1);
					if(it2!=it->second.end()){
						right = it2->second;
					}else{
						right = splitArray(nums, i+1, m-1, cache, sumsAll);
					}
				}else{
					right = splitArray(nums, i+1, m-1, cache, sumsAll);
				}
				int lMax = max(s, right);
				if( gMin == -1){
					gMin = lMax;
				} else {
					gMin = min(gMin, lMax);
				}
				if( s >= right) break;				
			}
			cache[m][start] = gMin;
			return gMin;
		}else{

			int sum = sumsAll[sumsAll.size()-1];
			if( start >0) sum -= sumsAll[start-1];		
			cache[m][start] = sum;
			return sum;
		}
	}
};

